import React from "react";

class DisplayInfor extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <div>My name is {this.props.name}</div>
                    <div>Age: {this.props.age}</div>
                </div>
            </div>
        );

    }
}

export default DisplayInfor;
